      display: grid;
      grid-template-rows: auto 1fr;
      color: #fff;
      font-family: sans-serif;
    }
    header{
      height: 120px;
      background: #ff0;
      width: 100%;
    }

      width: 120px;
      height: 120px;
    }

    main{
      display: grid;
      place-content: center;
    }

      color: #ff0;
      text-align: center;
    }
    
    nav{
      display: grid;
      gap: 12px;
      grid-auto-flow: column;
      place-content: center;
      margin-top: 32px;
    }
    
    a{
      background: #ff0;
      width: 40px;
      height: 40px;
      border-radius: 50px;
      display: grid;
      place-content: center;
    }
    svg{
      width: 24px;
      height: 24px;
    }
